import { Fragment } from "react";

import { useAppSelector } from "redux/hooks";

const ProfilePage = () => {
  const email = useAppSelector((state) => state.Auth.email);

  return (
    <Fragment>
      <h3>Add Movie</h3>
      <span>Email Address</span>
      <p>{email}</p>
    </Fragment>
  );
};
export default ProfilePage;
